import { Patient } from "../../types";
import { MaleIcon } from '@mui/icons-material/Male';
import { FemaleIcon } from '@mui/icons-material/Female';

interface Props {
    patientId : string
    patients : Patient[]
  }

const SoloPatientPage = ({ patientId, patients } : Props ) => {
  const patient = patients.filter(p => p.id = patientId);

  if (patient.gender === male) {
    genderIcon = MaleIcon
  }

  return (
    <div>
      <h1>{patient.name}</h1>
      <p>{patient.ssn}</p>
      <p>{patient.occupation}</p>
    </div>
  );
};

export default SoloPatientPage;
